import React from 'react' ;



function Navbar(props) {
  return(

    <nav>
    <div class="nav-wrapper">
  <a href="#!" class="brand-logo left"> {props.brandname}</a>
      <ul class="right hide-on-med-and-down">
        <li><a href="sass.html">Home</a></li>
        <li><a href="badges.html">About</a></li>
        <li><a href="collapsible.html">Services</a></li>
        <li><a href="mobile.html">Contact</a></li>
      </ul>
    </div>
  </nav>


  );
}


export function CustomFooter(props){
  return(
   <footer class="page-footer font-small blue">
       <div class="footer-copyright text-center py-3">Â© 2020 Copyright:
  <a href="https://mdbootstrap.com/"> {props.brandname}</a>
        
      </div>
    </footer>
    

  );
}

export default Navbar ;
